    public function getSourceContext()
    {
        return new Source("{% extends 'base.html.twig' %}
{% block customstylesheets %}
<link rel=\"stylesheet\" href=\"{{asset('assets/css/login.css')}}\">
{% endblock %}
{% block title %}Log in!{% endblock %}
{% block menu %}{% endblock %}

{% block main %}
<form method=\"post\" action=\"{{path('admin_main_page')}}\" class=\"form-signin\">
    {% if error %}
        <div class=\"alert alert-danger\">{{ error.messageKey|trans(error.messageData, 'security') }}</div>
    {% endif %}

    {% if app.user %}
        <div class=\"mb-3\">
            You are logged in as {{ app.user.username }}, <a href=\"{{ path('logout') }}\">Logout</a>
        </div>
    {% endif %}

    <h1 class=\"h3 mb-3 font-weight-normal\">Please sign in</h1>
    <label for=\"inputEmail\" class=\"sr-only\">Email</label>
    <input type=\"email\" value=\"{{ last_username }}\" placeholder=\"Email address\" name=\"email\" id=\"inputEmail\" class=\"form-control\" required autofocus>
    <label for=\"inputPassword\">Password</label>
    <input type=\"password\" name=\"password\" id=\"inputPassword\" class=\"form-control\" placeholder=\"Password\" required>

    <input type=\"hidden\" name=\"_csrf_token\"
           value=\"{{ csrf_token('authenticate') }}\">
        <div class=\"checkbox mb-3\">
            <label>
                <input type=\"checkbox\" name=\"_remember_me\"> Remember me
            </label>
        </div>
   

    <button class=\"btn btn-lg btn-primary btn-block\" type=\"submit\">Sign in</button>
    <p class=\"mt-5 mb-3 text-muted\">&copy; 2017-2018 <a href=\"{{path('main_page')}}\">main page</a></p>
</form>
{% endblock %}
{% block footer_links %}{% endblock %}
", "security/login.html.twig", "E:\\Video-Sharing-Platform\\templates\\security\\login.html.twig");
